CREATE TABLE gdp(
   region                               INTEGER  NOT NULL
  ,region_name                          VARCHAR(29) NOT NULL
  ,Year                                 INTEGER  NOT NULL
  ,GDP_in_constant_2010_prices_millions INTEGER  NOT NULL
  ,GDP_in_current_prices_millions       INTEGER  NOT NULL
  ,GDP_per_capita                       INTEGER  NOT NULL
  ,GDP_real_rates_of_growth_percent     NUMERIC(5,1)
  ,PRIMARY KEY(region,Year)
);
